INSERT INTO `calls` VALUES (35,'goodeej','goodeej@cheltladiescollege.org','2211','<div class=original>Typewriter Neutra tattooed Blue Bottle kitsch. Asymmetrical American Apparel Tumblr squid craft beer, crucifix church-key slow-carb. You probably haven\'t heard of them authentic mixtape distillery, slow-carb umami semiotics quinoa asymmetrical biodiesel synth farm-to-table. Blog Neutra beard kogi salvia, narwhal +1 Williamsburg skateboard authentic mlkshk. Tote bag street art you probably haven\'t heard of them, sustainable roof party Tonx letterpress. Raw denim cornhole salvia Wes Anderson, flexitarian roof party forage put a bird on it shabby chic keytar viral literally mlkshk sartorial before they sold out. Cred pork belly Kickstarter Brooklyn, Vice brunch Williamsburg polaroid bicycle rights flannel.</div><div class=update>this is my first update for this call, i dont have much to say but its an update anyhow <h3> Update By goodeej, 08/08/14 11:25</h3></div><div class=update>this is my second update to this call, still not got anything to say.  <h3> Update By goodeej, 08/08/14 11:42</h3></div><div class=update>Stupid call <h3> Closed By robertsap, 15/08/14 03:33 </h3></div>',14,'2014-08-08 11:11:17','2014-08-15 15:29:33','2014-08-15 15:29:33',2,1,'1','s117',1,14,'goodeej',1),(36,'goodeej','goodeej@cheltladiescollege.org','2211','<div class=original>Put a bird on it you probably haven\'t heard of them direct trade mustache fap, occupy jean shorts wolf. Selvage fap Wes Anderson pork belly, sriracha direct trade Intelligentsia seitan. Letterpress ethical yr vinyl mustache Vice. Twee tousled gastropub, ugh quinoa Wes Anderson McSweeney\'s tote bag semiotics squid Pitchfork single-origin coffee actually. Sriracha normcore Carles roof party sartorial skateboard, 90\'s cornhole. Mustache pour-over Wes Anderson skateboard lomo Pinterest. Ugh Etsy 90\'s cardigan readymade Shoreditch, artisan stumptown Vice fap freegan.</div><div class=update>close <h3> Closed By goodeej